import React, { useState } from 'react';

const Formulario = ({ onSubmit }) => {
  const [nomeCompleto, setNomeCompleto] = useState('');
  const [email, setEmail] = useState('');
  const [telefone, setTelefone] = useState('');

  // Campos relacionados à conta de energia
  const [codigoDaUnidadeConsumidora, setCodigoDaUnidadeConsumidora] = useState('');
  const [modeloFasico, setModeloFasico] = useState('monofasico');
  const [enquadramento, setEnquadramento] = useState('AX');
  const [historicoDeConsumoEmKWH, setHistoricoDeConsumoEmKWH] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Agrupe os dados do formulário
    const dadosFormulario = {
      nomeCompleto,
      email,
      telefone,
      informacoesDaFatura: [
        {
          codigoDaUnidadeConsumidora,
          modeloFasico,
          enquadramento,
          historicoDeConsumoEmKWH,
        },
      ],
    };

    onSubmit(dadosFormulario);
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Nome Completo:
        <input type="text" value={nomeCompleto} onChange={(e) => setNomeCompleto(e.target.value)} />
      </label>

      <label>
        Email:
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
      </label>

      <label>
        Telefone:
        <input type="tel" value={telefone} onChange={(e) => setTelefone(e.target.value)} />
      </label>

      {/* Campos relacionados à conta de energia */}
      <label>
        Código da Unidade Consumidora:
        <input
          type="text"
          value={codigoDaUnidadeConsumidora}
          onChange={(e) => setCodigoDaUnidadeConsumidora(e.target.value)}
        />
      </label>

      <label>
        Modelo Fásico:
        <select value={modeloFasico} onChange={(e) => setModeloFasico(e.target.value)}>
          <option value="monofasico">Monofásico</option>
          <option value="bifasico">Bifásico</option>
          <option value="trifasico">Trifásico</option>
        </select>
      </label>

      <label>
        Enquadramento:
        <select value={enquadramento} onChange={(e) => setEnquadramento(e.target.value)}>
          <option value="AX">AX</option>
          <option value="B1">B1</option>
          <option value="B2">B2</option>
          <option value="B3">B3</option>
        </select>
      </label>

      {/* Campos relacionados ao histórico de consumo */}
      <label>
        Histórico de Consumo (Fora de Ponta) em kWh:
        <input
          type="number"
          value={historicoDeConsumoEmKWH}
          onChange={(e) => setHistoricoDeConsumoEmKWH(e.target.value)}
        />
      </label>

      {/* Adicione mais campos para o histórico de consumo, se necessário */}

      <button type="submit">Submeter</button>
    </form>
  );
};

export default Formulario;
